import React from 'react';

const AdminDashboard = () => {
  return (
    <div>
      <h1>Admin Dashboard</h1>
      <button>Add Product</button>
      <button>View Orders</button>
      <button>View Customers</button>
    </div>
  );
};

export default AdminDashboard;
